  int sz = clauses.size();
  SpanQuery[] newClauses = new SpanQuery[sz];

  for (int i = 0; i < sz; i++) {
    SpanQuery clause = (SpanQuery) clauses.get(i);
    newClauses[i] = (SpanQuery) clause.clone();
  }
  SpanOrQuery soq = new SpanOrQuery(newClauses);
  return soq;
